import React from 'react';
import './section.css'
import {Card, CardBody, Col, Row} from "reactstrap";

const Section = () => {
    return (
        <div className='section'>
            <div className='ccc-4'>
                <h1 className='text-white'>Услуги</h1>
            </div>
            <Row>
                <Col md={3}>
                    <Card className='h-100'>
                        <div className='ccc-5'>
                            <h3 className='mt-3 offset-1'>Komilov Jahongir</h3>
                            <button className='offset-1'><h5>Заказать</h5></button>
                        </div>
                    </Card>

                </Col>
            </Row>
        </div>
    );
};

export default Section;
